namespace Weelo.Microservices.FileStorage.APITests
{
    public class ImagesControllerTests
    {
        private readonly Mock<ILogger<ImagesController>> loggerStub = new();
        private readonly Mock<IFirebaseManagerServiceBase> fireBaseManagerStub = new();

        [Fact]
        public async Task Post_ServerException_ReturnsStatus500InternalServerError()
        {
            // Arrange
            //fireBaseManagerStub.Setup(firebase => firebase.ConvertBase64ToStream(It.IsAny<string>()))
            //    .Returns(It.IsAny<StreamContent>());

            var controller = new ImagesController(loggerStub.Object, fireBaseManagerStub.Object);

            // Act
            var result = await controller.UploadIamge(new ImageDTO() { Id = "12345", Image = "", ImageName = "12345" }); ;  ;

            // Assert
            Assert.IsType<StatusCodeResult>(result.Result);
            var response = ((StatusCodeResult)result.Result);

            Assert.Equal<int>(response.StatusCode, StatusCodes.Status500InternalServerError);
        }
    }
